# Função para simulação dos resultados da primeira fase de cada grupo. 'dados' é o conjunto de dados que seja passado como parâmetro da função
def JogosGrupo(dados, grupo): 
    
    times = list(dados.loc[dados['Grupo']==grupo].index)        # Método .index() busca o índice dos elementos que estão em um mesmo grupo da copa

    time1, time2, time3, time4 = times  # 'times' é uma lista de 4 posições, que estão sendo atribuidas 
                                        # a time1, 2, 3 e 4 do respectivo grupo
    pt1, pt2, pt3, pt4 = 0, 0, 0, 0     # O grupo inicia a simulação dos seus jogos com todos os seus parâmetros zerados
    gp1, gp2, gp3, gp4 = 0, 0, 0, 0
    sg1, sg2, sg3, sg4 = 0, 0, 0, 0

    # Simulação de todos os jogos do grupo através da função 'Jogo()'
    jogo1 = Jogo(time1, time2)        # Rodada 1 
    jogo2 = Jogo(time3, time4)

    jogo3 = Jogo(time1, time3)        # Rodada 2
    jogo4 = Jogo(time2, time4)

    jogo5 = Jogo(time1, time4)        # Rodada 3
    jogo6 = Jogo(time2, time3)

    # Coleta e atualização dos parâmetros gols pro (gp), saldo de gols (sg) e pontos na partida (pt) para os dois jogos a cada nova rodada. 
    # Lembrando que a função 'Jogo()' retorna como output uma lista de 8 posições: [gols1, gols2, saldo1, saldo2, pontos1, pontos2, result, placar]
    gp1, gp2, sg1, sg2, pt1, pt2 = gp1 + jogo1[0], gp2 + jogo1[1], sg1 + jogo1[2], sg2 + jogo1[3], pt1 + jogo1[4], pt2 + jogo1[5]       # Rodada 1
    gp3, gp4, sg3, sg4, pt3, pt4 = gp3 + jogo2[0], gp4 + jogo2[1], sg3 + jogo2[2], sg4 + jogo2[3], pt3 + jogo2[4], pt4 + jogo2[5]

    gp1, gp3, sg1, sg3, pt1, pt3 = gp1 + jogo3[0], gp3 + jogo3[1], sg1 + jogo3[2], sg3 + jogo3[3], pt1 + jogo3[4], pt3 + jogo3[5]       # Rodada 2
    gp2, gp4, sg2, sg4, pt2, pt4 = gp2 + jogo4[0], gp4 + jogo4[1], sg2 + jogo4[2], sg4 + jogo4[3], pt2 + jogo4[4], pt4 + jogo4[5]

    gp1, gp4, sg1, sg4, pt1, pt4 = gp1 + jogo5[0], gp4 + jogo5[1], sg1 + jogo5[2], sg4 + jogo5[3], pt1 + jogo5[4], pt4 + jogo5[5]       # Rodada 3
    gp2, gp3, sg2, sg3, pt2, pt3 = gp2 + jogo6[0], gp3 + jogo6[1], sg2 + jogo6[2], sg3 + jogo6[3], pt2 + jogo6[4], pt3 + jogo6[5]

    partidas = [ time1 + ' x ' + time2,       # Lista para armanezar os resultados de todas as partidas do grupo
                 time3 + ' x ' + time4,
                 time1 + ' x ' + time3, 
                 time2 + ' x ' + time4,
                 time1 + ' x ' + time4,
                 time2 + ' x ' + time3 ]

    resultados = [ jogo1[6], jogo2[6], jogo3[6], jogo4[6], jogo5[6], jogo6[6] ]       # Saída 6 das listas 'jogoX[]'
    placares = [ jogo1[-1], jogo2[-1], jogo3[-1], jogo4[-1], jogo5[-1], jogo6[-1] ]   # Última saída (-1) das listas 'jogoX[]'
    cols = ['Pontos', 'Saldo de Gols', 'Gols Pró']                                    # Lista auxiliar para colunas de 'tab'

    # Cria um DataFrame com os resultados dos placares todas as partidas das 3 rodadas do grupo
    jogos = pd.DataFrame([partidas, placares, resultados]).transpose()        # Armazena no DataFrame métricas das partidas, placares e resultados
    jogos.columns = ['Partida', 'Placar', 'Resultado']                        # Adiciona colunas ao DataFrame 'jogos'

    # Cria um DataFrame da tabela final do grupo após simulação das 3 rodadas
    tab = pd.DataFrame([[pt1, pt2, pt3, pt4], [sg1, sg2, sg3, sg4], [gp1, gp2, gp3, gp4]], index = cols, columns = times).transpose()
    tab = tab.sort_values(cols, ascending = False)        # Ordena os times de acordo com a lista 'cols[]'
    tab['Posição'] = [1, 2, 3, 4]       # Adiciona uma nova coluna a tabela com o número das posições das seleções

    return [tab, jogos]

