# Função para resultado de jogos mata eliminatórios
def JogoMataMata(selecao1, selecao2): 
    jogo = Jogo(selecao1, selecao2)                             # Chama a função Jogo() para cálculo dos parâmetros da partida
    resultado = jogo[6]                                         # Atribui a 'resultado' o parâmetro da posição 6 (result) do output da função Jogo()
    if resultado == 'V':                                        # 'selecao1' avança
        return selecao1                 
    elif resultado == 'D':                                      # 'selecao1' não avança
        return selecao2
    else:
        return random.sample([selecao1, selecao2], 1)[0]        # Caso ocorra empato na função Jogo(), uma das seleções é escolhida aleatoriamente, pons o critério
                                                                # será de que se houve empate, as seleções estão equilibradas e possuem a mesma chance avançar

# Simulação da segunda fase da copa

def SimulaCopa(dados):

    # Construção do DataFrame de representação (info) dos dados de uma única simulação da copa
    cols = ['1st', '2nd', '3rd', '4th', 'Oitavas', 'Quartas', 'Semis', 'Final', 'Campeão']        # Colunas do DataFrame 
    n = dados.shape[0]                                                                            # 'n' é a quantidade de linhas dos 'dados' (32 seleções)
    m = len(cols)                                                                                 # 'm' é a quantidade de colunas da lista 'cols[]'
    aux = np.array(np.zeros(n*m).reshape(n, m))                                                   # Gera uma matriz n x m de zeros |.reshape() molda uma matriz sem alterar os seus dados
    info = pd.DataFrame(aux, columns = cols, index = dados.index)                                 # Transforma a matriz 'aux' em DataFrame
    info = info.astype(int)                                                                       # Transforma os valores do DataFrame 'info' para inteiros

    top16 = []                                                                                    # Lista para armazenar as seleções que passaram para as oitavas

    # 'for' que tem a função de acessar através da função JogosGrupo() o 1 e 2 lugar de cada grupo que avançam para as oitavas de final
    for i in list('ABCDEFGH'):
        a = JogosGrupo(dados, i)[0]                # atribui a 'a' os dados do DataFrame 'tab', posição '[0]' do output da JogosGrupo(), que é uma lista
        top16 += a.index[:2].tolist()              # Adiciona a lista 'top16' os dois primeiros índices (posições) de cada grupo e transforma os dados
                                                   # de 'a' que são do tipo Series em uma lista com o método 'tolist()'

        anomes = a.index.to_list()                 # Lista auxiliar para atualizar o DataFrame 'info' na fase de grupos onde os índices são os nomes das seleções do grupo
        info.at[anomes[0], '1st'] = 1              # Atribui o valor armazenado na posição '0' da lista 'anomes' à coluna '1st' de 'info'
        info.at[anomes[1], '2nd'] = 1
        info.at[anomes[2], '3rd'] = 1
        info.at[anomes[3], '4th'] = 1

    # Definição das 8 seleções que avançam para as quartas. qf1, qf2, qf3... são variáveis para armezenamento destas 8 seleções | as 16 seleções que jogaram as oitavas estão armazenadas
    # na lista 'top16[A1, A2, B1, B2, C1, C2, ...,]'

    qf1 = JogoMataMata(top16[0], top16[3])   #A1 x B2
    qf2 = JogoMataMata(top16[2], top16[1])   #B1 x A2
    qf3 = JogoMataMata(top16[4], top16[7])   #C1 x D2 
    qf4 = JogoMataMata(top16[6], top16[5])   #D1 x C2
    qf5 = JogoMataMata(top16[8], top16[11])  #E1 x F2
    qf6 = JogoMataMata(top16[10], top16[9])  #F1 x E2
    qf7 = JogoMataMata(top16[12], top16[15]) #G1 x H2
    qf8 = JogoMataMata(top16[14], top16[13]) #H1 x G2

    top8 = [qf1, qf2, qf3, qf4, qf5, qf6, qf7, qf8]         # lista para armazenar as seleções que disputarão as quartas de final


    # Definição das 4 seleções que avançam para as semifinais
    sf1 = JogoMataMata(qf1, qf3)
    sf2 = JogoMataMata(qf2, qf4) 
    sf3 = JogoMataMata(qf5, qf7) 
    sf4 = JogoMataMata(qf6, qf8) 

    top4 = [sf1, sf2, sf3, sf4]                             # lista para armazenar as seleções que disputarão as semifinais

    # Definição das 2 seleções que avançam para a final
    f1 = JogoMataMata(sf1, sf3) 
    f2 = JogoMataMata(sf2, sf4) 

    top2 = [f1, f2]                                         # lista para armazenar as seleções que disputarão a final

    # Definição da seleção campeã da copa do mundo
    top1 = JogoMataMata(f1, f2)                             # 'top1' armazena a seleção campeã

    # Atualização do DataFrame 'info'
    info.at[top16, 'Oitavas'] = 1                                                                 
    info.at[top8, 'Quartas'] = 1
    info.at[top4, 'Semis'] = 1
    info.at[top2, 'Final'] = 1
    info.at[top1, 'Campeão'] = 1

    return info                                                                                   # retorno do DataFrame 'info' com todas as informações da simulação de uma única copa

# Exemplo da função SimulaCopa()

SimulaCopa(selecoes)

# Função para simulação de S resultados da copa do mundo

def SimulacaoTotal(dados, S = 1000): 
    print('IA: "Iniciando simulação..."')

    info = SimulaCopa(dados)                                                                     # Primeira simulação é guardada na variável 'info'
    for i in range(S-1):                                                                         # 'for' simula S-1 copas do mundo (por default, S = 1000)
        info += SimulaCopa(dados)                                                                # A cada simulação, 'info' é atualizada
        if (i+2)%(S/10) == 0:                                                                    # A cada 10%, mensagem de atualização é mostrada
            print('IA: "Simulações de Copas do Mundo: {:.0f}% completas'.format(100*((i+2)/S)))    
    print('IA: "Simulação Finalizada."')
    return info.sort_values(by = 'Campeão', ascending = False)/S                                 # Retorna a frequência (/S) das colocações de cada seleção

S = 500
sim = SimulacaoTotal(selecoes, S) 
sim.to_excel('outputSimulaçõesCopaDoMundo.xlsx')          # Armazena num arquivo excel um ranking ordenado da frequência das seleções vencedoras para dado número de simulações
